import React from 'react'
import {Link} from 'react-router-dom';
import './Navigation.scss'

function Navigation() {
  return (
    <div className='nav'>
        <Link to='/'>Home</Link>
        <Link to='/about'>About</Link>
        <Link to='/project'>Project</Link>
        <Link to='/contact'></Link>
    </div>
  )
}

export default Navigation
